import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";
import ContactUs from "./ContactUs";
import Services from "./Services";
import pic1 from "../Images/right.webp";
import pic2 from "../Images/first.webp";
import pic3 from "../Images/second.webp";
import pic4 from "../Images/third.webp";
import pic5 from "../Images/forth.webp";
import pic6 from "../Images/fifth.webp";
import pic7 from "../Images/sixth.webp";
import pic8 from "../Images/one.webp";
import pic9 from "../Images/two.png";
import pic10 from "../Images/three.jpeg";
import pic11 from "../Images/four.webp";
import pic12 from "../Images/five.jpg";
import "./Home.css"; // Add this line to link custom CSS

const Home = () => {
  return (
    <div className="home-container">
      {/* Hero Section */}
      <div className="hero-section d-flex flex-column flex-lg-row align-items-center justify-content-between p-5 rounded-4 shadow-lg">
        <div className="hero-text col-lg-6 mb-4 mb-lg-0">
          <h1 className="display-5 fw-bold text-gradient">Home Services at Your Doorstep</h1>
          <div className="services-box mt-4 p-4 rounded-4">
            <h5 className="mb-4 text-secondary">What are you looking for?</h5>
            <Services />
          </div>
        </div>
        <div className="hero-image col-lg-6 text-center">
          <img
            src={pic1}
            alt="Home Services"
            className="img-fluid rounded-4 shadow"
            style={{ maxHeight: "500px", objectFit: "cover" }}
          />
        </div>
      </div>

      {/* Highlights */}
      <div className="highlight-section d-flex justify-content-start gap-5 mt-5 ps-4">
        <div className="highlight-box text-center p-3 shadow rounded-4">
          <h3>‚≠ê 4.8</h3>
          <p className="text-muted">Service Rating</p>
        </div>
        <div className="highlight-box text-center p-3 shadow rounded-4">
          <h3>üë• 12M+</h3>
          <p className="text-muted">Customers Globally</p>
        </div>
      </div>

      {/* Carousel Section */}
      <div className="carousel-section container mt-5">
        <h2 className="section-title mb-4">Gallery</h2>
        <div className="row g-4">
          {[pic2, pic3, pic4, pic5, pic6, pic7].map((pic, index) => (
            <div className="col-md-4" key={index}>
              <div className="img-card shadow rounded-4 overflow-hidden">
                <img src={pic} className="img-fluid w-100" style={{ height: "250px", objectFit: "cover" }} alt={`Slide ${index + 1}`} />
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* New & Noteworthy */}
      <div className="container mt-5">
        <h2 className="section-title mb-4">New and Noteworthy</h2>
        <div className="row g-4">
          {[
            { src: pic8, title: "Insta Maids" },
            { src: pic9, title: "Wall Panels" },
            { src: pic10, title: "Native Water Purifier" },
            { src: pic11, title: "Native Smart Locks" },
            { src: pic12, title: "Kitchen Cleaning" },
          ].map((item, i) => (
            <div className="col-md-2" key={i}>
              <div className="img-card text-center p-2 shadow-sm rounded-4">
                <img src={item.src} className="img-fluid rounded-3" style={{ height: "180px", objectFit: "cover" }} alt={item.title} />
                <p className="fw-bold mt-2">{item.title}</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Most Booked */}
      <div className="container mt-5">
        <h2 className="section-title mb-4">Most Booked Services</h2>
        <div className="row g-4">
          {[
            { src: pic8, title: "Insta Maids" },
            { src: pic9, title: "Wall Panels" },
            { src: pic10, title: "Native Water Purifier" },
            { src: pic11, title: "Native Smart Locks" },
            { src: pic12, title: "Kitchen Cleaning" },
          ].map((item, i) => (
            <div className="col-md-2" key={i}>
              <div className="img-card text-center p-2 shadow-sm rounded-4">
                <img src={item.src} className="img-fluid rounded-3" style={{ height: "180px", objectFit: "cover" }} alt={item.title} />
                <p className="fw-bold mt-2">{item.title}</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Contact Section */}
      <div className="mt-5">
        <ContactUs />
      </div>
    </div>
  );
};

export default Home;
